import React from "react";
import "./categories.css";
import { Link } from "react-router-dom";

export default function Categories() {
  return (
    <div className="container grid">

      <div className="category">
        <div className="upper">
          <img src="img/food-delivery.png" alt=""></img>
          <div className="upper-text">
            <h1 className="category-title">RECIPES</h1>
            <h3>Become an at home chef with these amazing recipes</h3>
            <div className="members">
              <img className="members-logo" src="img/group.png" alt=""></img>
              <p>13M MEMBERS</p>
            </div>
          </div>
        </div>
        <Link to="/HowTo/recipes">
          <button className="join">JOIN</button>
        </Link>
      </div> 
    </div>
  );
}
